import './ServiceCard.css';
import React from "react";
import database from "../Database/Database";

function CardPiece(title, content, result, price, logo) {
    return (
            <div className="card center">
                <div className="front">
                    <img className={"profLogo"} src ={logo} alt=" "/>
                    <h1>{title}</h1>
                </div>
                <div className="back">
                    <div className="back-content center">
                        <h2>{title}</h2>
                        <span>В пакет входит:</span>
                        <ul className='serviceDescription'>
                            {content.map((eee) => {
                                return(
                                    <li>{eee}</li>)
                            })}</ul>
                        <span>По итогам Вы получаете:</span>
                            <ul className='serviceDescription'>
                                {result.map((eee) => {
                                    return(
                                        <li>{eee}</li>)
                                })}</ul>
                            <button className='buyButton'>Приобрести за {price}</button>

                    </div>
                </div>
            </div>
    );
}
function ServiceCard () {
    return (
    <div className="serviceContainer">
        {database.map((serviceName) => {
            return (<CardPiece key={serviceName.id}
                               title={serviceName.title}
                               description={serviceName.description}
                               logo={serviceName.logo}
                               price={serviceName.price}
                               content={serviceName.content}
                               result={serviceName.result}
            />)
        })}

    </div>
    );
}


export default ServiceCard;
